import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlay, faStop, faCheck, faTrash, faCarSide } from '@fortawesome/free-solid-svg-icons';


import Button from 'components/commons/Button/Button';

import styles from './CarTrack.module.scss';

function CarTrack() {

   return(
      <div className = { styles.carTrack}>
         <div className = { styles.controlBlock }>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faPlay } color = "#28a745" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faCheck } color = "#48bfeeff" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faStop } color = "#ffc107" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faTrash } color = "#dc3545"/> }/>
         </div>
         <CarIcon />
      </div>
   )
}
const CarIcon = ({ width = 400, height = 200,color = "#333" }) => (
    <svg
  xmlns="http://www.w3.org/2000/svg"
  viewBox="0 0 640 512"
  width={width}
  height={height}
  fill={color}
>
  {/* Car body */}
  <path d="M16 368h608c8.8 0 16-7.2 16-16v-80c0-8.8-7.2-16-16-16H576l-32-80H96L64 272H16c-8.8 0-16 7.2-16 16v80c0 8.8 7.2 16 16 16z" />
  
  {/* Windows */}
  <path d="M96 192h448l32 80H64l32-80z" fill="#cce6ff" />
  
  {/* Wheels */}
  <circle cx="160" cy="368" r="48" fill="#333" />
  <circle cx="480" cy="368" r="48" fill="#333" />
  
  {/* Wheel details */}
  <circle cx="160" cy="368" r="24" fill="#999" />
  <circle cx="480" cy="368" r="24" fill="#999" />
  
  {/* Headlights */}
  <path d="M608 288h16v32h-16zM16 288h16v32H16z" fill="#ff0" />
  
  {/* Grille */}
  <path d="M288 272h64v16h-64z" fill="#666" />
</svg>
);



export default CarTrack;
